import java.util.*;
import java.io.*;

class  Main {
    public static void main(String[] args) {
        StringBuilder sb = new StringBuilder();
        Scanner sc = new Scanner(System.in);
        int n = sc.nextInt();
        int m = sc.nextInt();
        int x = sc.nextInt();
        int[] maleHeights = new int[n];
        int[] femaleHeights = new int[m];
        for (int i = 0; i < n; i++) {
            maleHeights[i] = sc.nextInt();
        }
        for (int i = 0; i < m; i++) {
            femaleHeights[i] = sc.nextInt();
        }
        Arrays.sort(maleHeights);
        Arrays.sort(femaleHeights);
        int left = 0;
        int right = Math.max(Math.abs(maleHeights[maleHeights.length - 1] - femaleHeights[0]),
                Math.abs(femaleHeights[femaleHeights.length - 1] - maleHeights[0]));
        int result = Integer.MAX_VALUE;
        while (left <= right) {
            int mid = (left + right) / 2;
            int count = countPair(maleHeights, femaleHeights, mid);
            if (count >= x) {
                result = Math.min(result, mid);
                right = mid - 1;
            } else {
                left = mid + 1;
            }
        }
        System.out.println(result);
    }

    public static int countPair(int[] maleHeights, int[] femaleHeights, int h) {
        int count = 0;
        int i = 0;
        int j = 0;
        while (i < maleHeights.length && j < femaleHeights.length) {
            int temp = maleHeights[i] - femaleHeights[j];
            if (Math.abs(temp) <= h) {
                count++;
                i++;
                j++;
            } else if (temp < 0) {
                i++;
            } else {
                j++;
            }
        }
        return count;
    }
}
